import React from "react";
import { render } from "react-dom";
import "carbon-components/css/carbon-components.min.css";
import {
  DataTable,
  TableContainer,
  Table,
  TableHead,
  TableRow,
  TableHeader,
  TableBody,
  TableCell,
  TableToolbar,
  TableToolbarContent,
  TableToolbarSearch,
  TableToolbarMenu,
  TableToolbarAction
} from "carbon-components-react";
import { Button } from "carbon-components-react";
import { headerData, rowData } from "./DataTable";

const TablaEstatus = () => (
  <div style={{ width: "auto" }}>
    <DataTable rows={rowData} headers={headerData}>
      {({ rows, headers, getHeaderProps, getTableProps }) => (
        <TableContainer title="DataTable">
          <TableToolbar>
            <TableToolbarContent>
              {/* pass in `onInputChange` change here to make filtering work */}
              <TableToolbarSearch />
              {/* onChange={onInputChange} */}
              <TableToolbarMenu>
                <TableToolbarAction>Action 1</TableToolbarAction>
                <TableToolbarAction>Action 2</TableToolbarAction>
                <TableToolbarAction>Action 3</TableToolbarAction>
              </TableToolbarMenu>
              <Button>Primary Button</Button>
            </TableToolbarContent>
          </TableToolbar>
          <Table {...getTableProps()}>
            <TableHead>
              <TableRow>
                {headers.map((header) => (
                  <TableHeader {...getHeaderProps({ header })}>
                    {header.header}
                  </TableHeader>
                ))}
              </TableRow>
            </TableHead>
            <TableBody>
              {rows.map((row) => (
                <TableRow key={row.id}>
                  <TableCell>a</TableCell>

                  {/* {row.cells.map((cell) => (
                    <TableCell key={cell.id}>{cell.value}</TableCell>
                  ))} */}
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </DataTable>
  </div>
);

export default TablaEstatus;
